import Card from "../UI/Card";
import classes from "../Meetups/NewMeetupForm.module.css"

function NewMeetupForm(){
     return <Card>
          <form className={classes.form}>
               <div className={classes.control}>
                    <label></label>
               </div>
          </form>
     </Card>
}

export default NewMeetupForm;
